import { reducer, initialState } from "./Context-Reducer/reducer";
import { StateProvider } from "./Context-Reducer/StateProvider";


ReactDOM.render(
    <BrowserRouter>
  <StateProvider initialState={initialState} reducer={reducer}>
      <App />
  </StateProvider>
    </BrowserRouter>,

document.getElementById('root')
